import React from "react";
import classes from "./UserList.module.css";


function UserList(props){

    console.log(props.data)
    return (
        <div className={classes.users}>
            {props.data.map((user) => {
            <ul>

                    <li>{user.userName}</li>

            </ul>})}
        </div>
    )
}

export default UserList;
